module.exports = {
  root: true,
  extends: ['@theguild', 'plugin:tailwindcss/recommended'],
  rules: {
    'no-empty': 'off',
    '@typescript-eslint/explicit-module-boundary-types': 'off',
    '@typescript-eslint/no-use-before-define': 'off',
    '@typescript-eslint/no-namespace': 'off',
    '@typescript-eslint/no-empty-interface': 'off',
    '@typescript-eslint/no-empty-function': 'off',
    '@typescript-eslint/no-var-requires': 'off',
    '@typescript-eslint/no-explicit-any': 'off',
    '@typescript-eslint/no-non-null-assertion': 'off',
    '@typescript-eslint/explicit-function-return-type': 'off',
    '@typescript-eslint/ban-ts-ignore': 'off',
    '@typescript-eslint/ban-types': 'off',
    'import/no-extraneous-dependencies': [
      'error',
      { devDependencies: ['**/*.test.ts', '**/*.spec.ts', '**/test/**/*.ts'] },
    ],

    // todo: enable
    'unicorn/filename-case': 'off',
    'import/extensions': 'off',
    'import/no-default-export': 'off',
    // todo: enable in v3
    'unicorn/prefer-node-protocol': 'off',
    'prefer-object-has-own': 'off',
  },
  env: {
    node: true,
  },
  overrides: [
    {
      files: ['website/**'],
      extends: '@theguild/eslint-config/react',
    },
    {
      files: ['**/tests/**/*.{js,ts,tsx}', '**/graphql-codegen-testing/**/*.ts', '*.spec.ts'],
      env: {
        jest: true,
      },
      rules: {
        'import/no-extraneous-dependencies': 'off',
      },
    },
    {
      files: '**/tests/fixtures/*.{ts,js}',
      rules: {
        '@typescript-eslint/no-unused-vars': 'off',
      },
    },
    {
      files: ['packages/**/*.{,c,m}ts{,x}'],
      parserOptions: {
        project: ['./tsconfig.json'],
      },
    },
    {
      files: ['scripts/*.{ts,js}', 'prettier.config.cjs', 'jest.config.js', 'jest.project.js'],
      rules: {
        '@typescript-eslint/no-require-imports': 'off',
      },
    },
  ],
  ignorePatterns: [
    'dev-test',
    'website',
    'examples/**',
    '**/tests/test-files/**',
    '**/tests/test-documents/**',
    '**/react-app-env.d.ts',
    'packages/presets/swc-plugin/tests/fixtures/simple-uppercase-operation-name.js',
    'packages/presets/swc-plugin/tests/fixtures/simple-uppercase-operation-name.other-dir.js',
    '**/build/**/*',
    '**/dist/**/*',
  ],
};

const PROJECTS = false;
const CI = !!process.env.CI;

module.exports =
  !PROJECTS || CI
    ? require('./jest.project')({ dirname: __dirname, projectMode: PROJECTS })
    : {
        rootDir: __dirname,
        projects: ['<rootDir>/packages/**/*/jest.config.js'],
        resolver: 'bob-the-bundler/jest-resolver.js',
      };

const { resolve } = require('path');
// eslint-disable-next-line import/no-extraneous-dependencies -- false positive
const { pathsToModuleNameMapper } = require('ts-jest');

const ROOT_DIR = __dirname;
const TSCONFIG = resolve(ROOT_DIR, 'tsconfig.json');
const tsconfig = require(TSCONFIG);
const CI = !!process.env.CI;

module.exports = ({ dirname, projectMode = true }) => {
  const pkg = require(resolve(dirname, 'package.json'));

  return {
    ...(CI || !projectMode ? {} : { displayName: pkg.name.replace('@graphql-codegen/', '') }),
    transform: { '^.+\\.tsx?$': 'babel-jest' },
    testEnvironment: 'node',
    rootDir: dirname,
    restoreMocks: true,
    reporters: ['default'],
    modulePathIgnorePatterns: ['dist', '.bob'],
    moduleNameMapper: pathsToModuleNameMapper(tsconfig.compilerOptions.paths, { prefix: `${ROOT_DIR}/` }),
    cacheDirectory: resolve(ROOT_DIR, `${CI ? '' : 'node_modules/'}.cache/jest`),
    setupFiles: [`${ROOT_DIR}/dev-test/setup.js`],
    collectCoverage: false,
    testTimeout: 20_000,
    resolver: './node_modules/bob-the-bundler/jest-resolver.cjs',
    snapshotFormat: {
      escapeString: false,
    },
  };
};

/* eslint-disable import/no-extraneous-dependencies */
const { plugins, ...prettierConfig } = require('@theguild/prettier-config');

module.exports = {
  ...prettierConfig,
  plugins: [
    ...plugins,
    // `prettier-plugin-svelte` and `svelte` packages used for formatting ```svelte code blocks in md/mdx files
    require('prettier-plugin-svelte'),
    // Sort classes in website
    require('prettier-plugin-tailwindcss'),
  ],
  tailwindConfig: './website/tailwind.config.ts',
};

{
  "extends": ["github>the-guild-org/shared-config:renovate"],
  "automerge": true,
  "major": {
    "automerge": false
  },
  "lockFileMaintenance": {
    "enabled": true,
    "automerge": true
  },
  "lockFileMaintenance": {
    "enabled": true,
    "automerge": true
  },
  "packageRules": [
    {
      "excludePackagePatterns": [
        "@changesets/*",
        "typescript",
        "^@theguild/",
        "next",
        "tailwindcss",
        "@whatwg-node/*",
        "graphql-jit",
        "husky",
        "@types/lz-string",
        "swc*"
      ],
      "matchPackagePatterns": ["*"],
      "matchUpdateTypes": ["minor", "patch"],
      "groupName": "all non-major dependencies",
      "groupSlug": "all-minor-patch"
    }
  ]
}
